import React from 'react';
import BigNumber from 'bignumber.js';

import { BalanceBlock, NumberBlock, Card } from '../common/index';

type WithdrawPageHeaderProps = {
  accountVestingBalance: BigNumber,
  accountAvalibleBalance: BigNumber,
  accountVestedBalance: BigNumber,
  todayNumber: BigNumber,
  startDayNumber: BigNumber
};



const WithdrawPageHeader = ({
  accountVestingBalance, accountAvalibleBalance, accountVestedBalance, todayNumber, startDayNumber
}: WithdrawPageHeaderProps) => (
  <div>
  <div style={{ padding: '2%', display: 'flex', alignItems: 'center' }}>
    <Card label={"Total Allocated Token"} value={<BalanceBlock asset="" balance={accountVestingBalance} suffix={" COOK"}/>}/>
    <Card label={"Vesting Token"} value={<BalanceBlock asset="" balance={accountVestingBalance.minus(accountVestedBalance)} suffix={" COOK"}/>}/>
    <Card label={"Vested Token"} value={<BalanceBlock asset="" balance={accountVestedBalance} suffix={" COOK"}/>}/>

  </div>
  <div style={{ padding: '2%', display: 'flex', alignItems: 'center'}}>
    <Card label={"Claimed Token"} value={<BalanceBlock asset="" balance={accountVestedBalance.minus(accountAvalibleBalance)} suffix={" COOK"}/>}/>
    <Card label={"Available Token"} value={<BalanceBlock asset="" balance={accountAvalibleBalance} suffix={" COOK"}/>}/>
  </div>
  </div>
);


export default WithdrawPageHeader;
